import { getQueueList } from '@/api/onlineDev/integrate'
export default ({
  data() {
    return {
      drawerVisible: false,
      list: [],
      listLoading: false
    }
  },
  methods: {
    open() {
      this.drawerVisible = true
      this.listLoading = false
      this.initData()
    },
    initData() {
      this.list = []
      this.listLoading = true
      getQueueList().then(res => {
        this.list = res.data || []
        this.listLoading = false
      }).catch()
    }
  }
})
